import TextField from '@mui/material/TextField';
import React, { useState, ChangeEvent } from 'react';

export default function LoginNav() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleUsernameChange = (e: ChangeEvent<HTMLInputElement>) => {
        setUsername(e.target.value);
    };

    const handlePasswordChange = (e: ChangeEvent<HTMLInputElement>) => {
        setPassword(e.target.value);
    };

    const handleSubmit = () => {
        console.log('Username:', username);
        console.log('Password:', password);

        setUsername('');
        setPassword('');
    };

    return (
        <div>
            <div className='loginNav' style={{ display: 'flex' }}>
                <div className='RegisterButton' style={{ padding: 15 }}>
                    <h2>Register</h2>
                </div>
                <div className='LoginButton' style={{ padding: 15 }}>
                    <h2>Login</h2>
                </div>
            </div>
            <div className='loginInput' style={{ padding: 30 }}>
                <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                <h4>Username:</h4>
                <input type="text" value={username} onChange={handleUsernameChange} />
                <h4>Password:</h4>
                <input type="text" value={password} onChange={handlePasswordChange} />
            </div>
            <div className='submitButton' style={{ padding: 30 }}>
                <button onClick={handleSubmit}>Submit</button>
            </div>
        </div>
    );
}
